import React from 'react';
import Logo from './components/Logo';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <Logo />
        <nav>
          <a href="#home">Home</a>
          <a href="#features">Features</a>
          <a href="#how-it-works">How It Works</a>
          <a href="#pricing">Pricing</a>
          <a href="#contact">Contact</a>
        </nav>
      </header>
      <main>
        <div className="main-content">
          <h1>
            <span className="heading-line">Manage Your</span>
            <span className="heading-line">Online Reputation</span>
          </h1>
          <p className="subtitle">Take control of your digital presence</p>
          <div className="cta-buttons">
            <button className="get-started">Get Started</button>
            <button className="features">Features</button>
          </div>
        </div>
      </main>
      <Particles
        params={{
          particles: {
            number: {
              value: 80,
              density: {
                enable: true,
                value_area: 800
              }
            }
          }
        }}
        style={{
          position: "fixed",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%",
          zIndex: -1
        }}
      />
    </div>
  );
}

export default App;
